const Container = styled.div`
    width: 1903px;
    position: relative;

`
const InContainer = styled.div`
    width: 1040px;
    margin: 0 432px;
    padding: 0 20px;
    text-align: right;
    background: #32325d;
    h1{
        margin-bottom: 100px;
        color: #fff;
        position: relative;
        z-index: 1;
        font-weight: 400;

    }
`





class DeepDive extends React.Component {
  render(){
    return (
        <Container>
        <Back4/>
            <InContainer>
                <Title title="A deep dive into the Payments stack"/>
            </InContainer>



        </Container>


    );
  }
}
export default DeepDive;
